Every Saturday at 3-6PM EST GMT-5 Tournament Gaming World holds a CoD4:MW battle. This map pack is required to play in the tournament. It will install into CoD4:MWusermaps and contains 33 maps. All maps are released under the GNU/GPL license and you are free to redistribute it to anyone you want. To join the tournament, follow the instructions at [url=http://www.tournamentgamingworld.com]TournamentGamingWorld.com[/url]. Also feel free to join our CoD4:MW Xfire group by [url=http://www.xfire.com/clans/tgwcod/] clicking here[/url]. Even if you don't want to participate in the Tournament, enjoy these map packs anyway!

Contains 33 maps, don't really want to get a list of them but you can be assured that they're there ;)

[u][b]I also want to thank Mininova for helping us distribute it. Thanks Mininova, it would not be possible without you![/b][/u]

